import React, { useState, useEffect } from 'react';
import {
  Container,
  Typography,
  Paper,
  Tabs,
  Tab,
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  Box
} from '@mui/material';

function TabPanel(props) {
  const { children, value, index, ...other } = props;
  return (
    <div
      role="tabpanel"
      hidden={value !== index}
      {...other}
    >
      {value === index && <Box p={3}>{children}</Box>}
    </div>
  );
}

export default function DatabaseView() {
  const [value, setValue] = useState(0);
  const [uccRegistrations, setUccRegistrations] = useState([]);
  const [orders, setOrders] = useState([]);

  useEffect(() => {
    // Fetch UCC registrations
    fetch('http://localhost:4000/api/database/ucc-registrations')
      .then(res => res.json())
      .then(data => {
        if (data.success) {
          setUccRegistrations(data.data);
        }
      })
      .catch(err => console.error('Error fetching UCC registrations:', err));

    // Fetch orders
    fetch('http://localhost:4000/api/database/orders')
      .then(res => res.json())
      .then(data => {
        if (data.success) {
          setOrders(data.data);
        }
      })
      .catch(err => console.error('Error fetching orders:', err));
  }, []);

  const handleChange = (event, newValue) => {
    setValue(newValue);
  };

  return (
    <Container maxWidth="lg">
      <Typography variant="h4" component="h1" gutterBottom sx={{ mt: 4 }}>
        Database Records
      </Typography>

      <Paper sx={{ width: '100%', mb: 2 }}>
        <Tabs value={value} onChange={handleChange} centered>
          <Tab label="UCC Registrations" />
          <Tab label="Orders" />
        </Tabs>

        <TabPanel value={value} index={0}>
          <TableContainer>
            <Table>
              <TableHead>
                <TableRow>
                  <TableCell>Client Code</TableCell>
                  <TableCell>Name</TableCell>
                  <TableCell>Email</TableCell>
                  <TableCell>Registration Date</TableCell>
                  <TableCell>Status</TableCell>
                </TableRow>
              </TableHead>
              <TableBody>
                {uccRegistrations.map((reg) => (
                  <TableRow key={reg.clientCode}>
                    <TableCell>{reg.clientCode}</TableCell>
                    <TableCell>{`${reg.firstName} ${reg.lastName}`}</TableCell>
                    <TableCell>{reg.email}</TableCell>
                    <TableCell>
                      {new Date(reg.registrationDate).toLocaleDateString()}
                    </TableCell>
                    <TableCell>
                      {reg.responseData?.status || 'Completed'}
                    </TableCell>
                  </TableRow>
                ))}
              </TableBody>
            </Table>
          </TableContainer>
        </TabPanel>

        <TabPanel value={value} index={1}>
          <TableContainer>
            <Table>
              <TableHead>
                <TableRow>
                  <TableCell>Order Ref</TableCell>
                  <TableCell>Client Code</TableCell>
                  <TableCell>Scheme Code</TableCell>
                  <TableCell>Amount</TableCell>
                  <TableCell>Order Date</TableCell>
                  <TableCell>Status</TableCell>
                </TableRow>
              </TableHead>
              <TableBody>
                {orders.map((order) => (
                  <TableRow key={order.orderRefNumber}>
                    <TableCell>{order.orderRefNumber}</TableCell>
                    <TableCell>{order.clientCode}</TableCell>
                    <TableCell>{order.schemeCode}</TableCell>
                    <TableCell>₹{order.amount.toLocaleString()}</TableCell>
                    <TableCell>
                      {new Date(order.orderDate).toLocaleDateString()}
                    </TableCell>
                    <TableCell>{order.status}</TableCell>
                  </TableRow>
                ))}
              </TableBody>
            </Table>
          </TableContainer>
        </TabPanel>
      </Paper>
    </Container>
  );
}
